(117, 'widget_custom_html', 'a:4:{i:2;a:2:{s:5:\"title\";s:0:\"\";s:7:\"content\";s:279:\"  <p class=\'text-center about_text__p\'>\r\n                        Временные финансовые затруднения легко решаемая проблема, если вы являетесь владельцем автомобиля.\r\n                        </p>\";}i:3;a:3:{s:5:\"title\";s:0:\"\";s:7:\"content\";s:1222:\"       <div class=\"col-md-10 about_us__condit\">\r\n                        <h3>Қысқаша шарттар</h3>\r\n                        <p class=\'about_text__p\'>Жүргізу құқығымен көлік құралымен қамтамасыз етілген шағын несие. Бұл жағдайда автокөлік пайдалануды \r\n                жалғастыра отырып, оның қолында шағын несие сомасын алатын клиентте қалады.\r\n                        </p>\r\n                        <p class=\'about_text__p\'>\'Микрокредиттік келісімшарттың барлық мерзімі ішінде көлік құралы біздің компанияның қауіпсіз учаскесінде қалады.\r\n                Клиент кез келген уақытта автотұраққа келіп, көлігінің бүтін және қауіпсіз екендігіне көз жеткізе алады.\r\n                <br> <br>\r\n                Екі жағдайда да кепілдеме жол полициясында немесе әкімдікте тіркеледі.\'</p>\r\n                    </div>\";s:12:\"bogo_locales\";a:2:{i:0;s:5:\"en_US\";i:1;s:2:\"kk\";}}i:4;a:3:{s:5:\"title\";s:0:\"\";s:7:\"content\";s:1265:\"       <div class=\"col-md-10 about_us__condit\">\r\n                        <h3>Краткие условия</h3>\r\n                        <p class=\'about_text__p\'>Микрокредит под залог транспортного средства с правом управления. В этом случае автомобиль остается у клиента, который получает на руки сумму микрокредита, продолжая пользоваться автомобилем.\'\r\n                        </p>\r\n                        <p class=\'about_text__p\'>Транспортное средство на весь срок действия договора микрокредита остается на охраняемой площадке нашей компании. \r\n                В любое время клиент может приехать на стоянку и убедиться, в том, что его автомобиль находится в целостности и сохранности.\r\n                <br> <br>\r\n                В обоих случаях залог регистрируется в дорожной полиции, либо в акимате.</p>\r\n                    </div>\";s:12:\"bogo_locales\";a:2:{i:0;s:5:\"en_US\";i:1;s:5:\"ru_RU\";}}s:12:\"_multiwidget\";i:1;}', 'yes'),
