(208, 'widget_l_widget_condition', 'a:10:{i:2;a:2:{s:14:\"condition_name\";s:322:\"Сумма микрокредита может достигать 80% от рыночной стоимости авто, при этом максимальную                  сумму микрокредита выдаем клиентам, имеющим положительную кредитную историю.\";s:12:\"bogo_locales\";a:2:{i:0;s:5:\"en_US\";i:1;s:5:\"ru_RU\";}}i:3;a:2:{s:14:\"condition_name\";s:170:\"Минимальная сумма микрокредита – 100 000 тенге. Максимальная сумма микрокредита – 25 000 000 тенге\'\";s:12:\"bogo_locales\";a:2:{i:0;s:5:\"en_US\";i:1;s:5:\"ru_RU\";}}i:4;a:2:{s:14:\"condition_name\";s:160:\"Ставка вознаграждения за 30 дней —3.7% Годовая эффективная ставка вознаграждения — от 18%\'\";s:12:\"bogo_locales\";a:2:{i:0;s:5:\"en_US\";i:1;s:5:\"ru_RU\";}}i:5;a:2:{s:14:\"condition_name\";s:297:\"Шағын несие мөлшері автомобильдің нарықтық құнының 80% -на жетуі мүмкін,                  ал шағын несиенің максималды сомасы оң несиелік тарихы бар клиенттерге беріледі.\";s:12:\"bogo_locales\";a:1:{i:0;s:2:\"kk\";}}i:6;a:2:{s:14:\"condition_name\";s:170:\"Шағын несиенің ең төменгі мөлшері - 100 000 теңге. Шағын несиенің максималды сомасы - 25 000 000 теңге\";s:12:\"bogo_locales\";a:1:{i:0;s:2:\"kk\";}}i:7;a:2:{s:14:\"condition_name\";s:136:\"30 күнге сыйақы мөлшерлемесі - 3,7% Жылдық тиімді сыйақы мөлшерлемесі - 18% -дан\";s:12:\"bogo_locales\";a:1:{i:0;s:2:\"kk\";}}i:8;a:2:{s:14:\"condition_name\";s:280:\"Шағын несие мөлшері автомобильдің нарықтық құнының 80% -на жетуі мүмкін, ал шағын несиенің максималды сомасы оң несиелік тарихы бар клиенттерге беріледі.\";s:12:\"bogo_locales\";a:1:{i:0;s:2:\"kk\";}}i:9;a:2:{s:14:\"condition_name\";s:170:\"Шағын несиенің ең төменгі мөлшері - 100 000 теңге. Шағын несиенің максималды сомасы - 25 000 000 теңге\";s:12:\"bogo_locales\";a:1:{i:0;s:2:\"kk\";}}i:10;a:2:{s:14:\"condition_name\";s:136:\"30 күнге сыйақы мөлшерлемесі - 3,7% Жылдық тиімді сыйақы мөлшерлемесі - 18% -дан\";s:12:\"bogo_locales\";a:1:{i:0;s:2:\"kk\";}}s:12:\"_multiwidget\";i:1;}', 'yes'),
(209, 'widget_l_widget_abouttext', 'a:4:{i:2;a:6:{s:12:\"headTextName\";s:9:\"О нас\";s:13:\"aboutTextName\";s:184:\"Временные финансовые затруднения легко решаемая проблема, если вы являетесь владельцем автомобиля.\";s:11:\"aboutChName\";s:145:\"Наша компания выдает деньги под залог транспортного средства в день обращения.\";s:8:\"aboutNew\";s:430:\"Мы предоставляем микрокредиты под залог транспортных средств уже не первый год. Для удобства клиентов работают более двух десятков отделений функционируют в крупных населенных центрах по всей территории Казахстана.  Краткие условия\";s:9:\"shortName\";s:0:\"\";s:12:\"bogo_locales\";a:2:{i:0;s:5:\"en_US\";i:1;s:5:\"ru_RU\";}}i:3;a:4:{s:13:\"aboutTextName\";s:2:\"rr\";s:11:\"aboutChName\";s:4:\"tert\";s:8:\"aboutNew\";s:4:\"erer\";s:9:\"shortName\";s:2:\"er\";}i:4;a:6:{s:12:\"headTextName\";s:19:\"Біз туралы\";s:13:\"aboutTextName\";s:158:\"Уақытша қаржылық қиындықтар - егер сіздің жеке көлігіңіз болса, оңай шешілетін мәселе.\";s:11:\"aboutChName\";s:137:\"Біздің компания өтініш берген күні көліктің қауіпсіздігіне ақша шығарады.\";s:8:\"aboutNew\";s:393:\"Біз бірнеше жылдан бері көлік құралдарымен кепілдендірілген шағын несиелер береміз. Клиенттерге ыңғайлы болу үшін                  жиырмадан астам филиал бүкіл Қазақстан бойынша ірі халықтық орталықтарда жұмыс істейді.\";s:9:\"shortName\";s:0:\"\";s:12:\"bogo_locales\";a:2:{i:0;s:5:\"en_US\";i:1;s:2:\"kk\";}}s:12:\"_multiwidget\";i:1;}', 'yes'),
